script: |
  super -f text -I q11864.spq | sort > q11864.out

inputs:
  - name: q11864.spq
    data: |
      SELECT DISTINCT + 16 AS col2, - 30 + + + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE - CAST ( + col2 AS INTEGER ) / - 79 * - - ( - col2 ) + 8 + - col0 * - + col0 BETWEEN + - col2 AND - CAST ( + col0 AS INTEGER );
  - name: tab0

outputs:
  - name: q11864.out
    data: |
